import Layout from '../components/Layout';
import SignupComponent from '../components/auth/SignupComponent';
import Link from 'next/link';

const signup = ()=>{

    return(
        <Layout>
            <h2>Signup page</h2>
            <div className="row">
                <div className="col-md-6 offset-md-3"></div>
            </div>
            <SignupComponent/>
            
           
        </Layout>
    )
}

export default signup;
